import React from "react";

const LeaderBoard = props => {
  return (
    <table>
      <caption>LeaderBoard</caption>
      <tr>
        <th>Name</th>
        <th>Score</th>
      </tr>
      <tr>
        <td>Jill</td>
        <td>3</td>
      </tr>
    </table>
  );
};

export default LeaderBoard;
